// For GCC
#pragma GCC diagnostic push
#pragma GCC diagnostic ignored "-Wdeprecated-declarations"
#endif

        Q_EMIT storage_managedFolders_setIamPolicySignalE(output, error_type, error_str);
        Q_EMIT storage_managedFolders_setIamPolicySignalEFull(worker, error_type, error_str);

